import logo from './logo.svg';
import './App.css';
import { Router } from 'react-router-dom';
import ItemInputPage from './pages/ItemInputPage';
import IndexPage from './pages/IndexPage';
import ItemPage from './pages/ItemPage';
import ItemListPage from './pages/ItemListPage';

function App() {
  return (
    <>
      <Router component={IndexPage} path={'/'} exact />
      <Router component={ItemInputPage} path={'/input'} />
      <Router component={ItemPage} path={'/item/:itemId'} />
      <Router component={ItemListPage} path={'/item'} />
    </>
  );
}

export default App;
